window.bookSummaryJSON = "<p><b>From internationally bestselling author K. A. Tucker comes the dark and sexy Dirty Empire series.</b></p> <p><b>Mercy Wheeler and Gabriel Easton's sordid tale continues in </b><b><i>Gabriel Fallen</i></b><b> as Mercy finds herself heading down a dangerous path.</b></p> <p>Gabriel has made an art of dangling what I'm most desperate for in front of me, what he knows I can't refuse, no matter the cost. In this case, that cost continues to be me. </p> <p>He is still a scoundrel, but I'm starting to see something more. </p> <p>And while our bargain is proving advantageous in ways I never anticipated, the risks that come with being associated with a man like him are becoming painfully clear. </p> <p>But how much longer before this arrangement with Gabriel costs me everything I am?</p> <p>Contains mature themes.</p>"; 
